n\n","\n","- These three lexicons make use of the unigrams. Unigrams are a type of n-gram model that consists of a sequence of 1 item, that is, a word collected from a given textual data.\n","\n","- In the AFINN lexicon model scores the words in a range from -5 to 5. The increase in negativity corresponds the negative sentiment whereas an increase in positivity corresponds the positive one. \n","- The bing lexicon model on the other hand, classifies the sentiment into a binary category of negative or positive. \n","- The loughran model that performs analysis of the shareholder’s reports. In this project, we will make use of the bing lexicons to extract the sentiments out of our data. \n","\n","#### Reference: [ScienceDirect](https://www.sciencedirect.com/science/article/abs/pii/S095741741830143X)"]},{"cell_type":"markdown","id":"a84df6d3","metadata":{"papermill":{"duration":0.007805,"end_time":"2024-08-02T15:43:22.098096","exception":false,"start_time":"2024-08-02T15:43:22.090291","status":"completed"},"tags":[]},"source":["# Sentiments"]},{"cell_type":"markdown","id":"326df582","metadata":{"papermill":{"duration":0.006855,"end_time":"2024-08-02T15:43:22.111792","exception":false,"start_time":"2024-08-02T15:43:22.104937","status":"completed"},"tags":[]},"source":["## We can retrieve these lexicons using the get_sentiments() function. We can implement this as follows:"]},{"cell_type":"code","execution_count":4,"id":"412b46c7","metadata":{"execution":{"iopub.execute_input":"2024-08-02T15:43:22.129716Z","iopub.status.busy":"2024-08-02T15:43:22.127794Z","iopub.status.idle":"2024-08-02T15:43:22.19925Z","shell.execute_reply":"2024-08-02T15:43:22.196808Z"},"papermill":{"duration":0.083604,"end_time":"2024-08-02T15:43:22.202305","exception":false,"start_time":"2024-08-02T15:43:22.118701","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6786 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>word</th><th sco